description:
Dexter - Season 4 - Episode 1 - &quot;Living the Dream&quot;

Six months after the season finale, Dexter is now living with three kids and a wife in a new home. Along with his new son Harrison, the complexities of being a suburban father of three is making it difficult for Dexter to concentrate on his work. His lack of sleep leads him to let a murderer walk by bringing the wrong documents to court and puts a strain on his life outside of the office. Also, a now retired Agent Lundy has returned to finally capture the &quot;Trinity Killer&quot; who has arrived in Miami. The episode ends after Dexter commits a hasty kill, but crashes his car after falling asleep. 

Enjoy.
